import Card from "../../../UI/Card/Card";
import Title from "../../../UI/Title/Title";
import SubTitle from "../../../UI/SubTitle/SubTitle";
import style from "./AccountNews.module.css";

const newsArr = [];

function AccountNews(props) {
  async function getNews() {
    const data = await fetch(
      "https://newsapi.org/v2/top-headlines?country=us&category=business&apiKey=5295e93382ff4fd1a92c1256f5843d3f"
    );

    const res = await data.json();

    console.log(res);
    newsArr.push(res);
  }
  //   if (newsArr.length === 0) getNews();

  let content =
    "the S&P 500 index fell below its 50-day moving average. Apple (AAPL) also broke through the 50-day line, but industrials, including fellow Dow Jones giant Caterpillar (CAT), as well as miners, steelmakers and materials firms were big losers. But growth stocks had a solid week overall. Microsoft (MSFT), unlike fellow tech titan Apple stock, rallied from its 10-week line. Small caps held key support. Oil and gas stocks had a big week, with Devon Energy (DVN) clearing an early entry and flirting with an outright breakout. Specialty footwear plays Crocs (CROX), Deckers Outdoor (DECK) and Boot Barn (BOOT) rallied, with the latter two actionable. Chipotle Mexican Grill (CMG) is among several restaurant chains trying to get back on the investing menu."
      .slice(0, 100)
      .padEnd(110, ".");

  console.log("aaa");
  return (
    <Card>
      <Title className={style.title}>latest news</Title>
      <SubTitle className={style.subTitle}>
        "market rally at turning point; what to do now - investors' business
        daily"
      </SubTitle>
      <BiRefresh />
      <div className={style["img__container"]}>
        <img
          className={style.img}
          src="https://kubrick.htvapps.com/htv-prod-media.s3.amazonaws.com/images/california-budget-1585234231.jpg?crop=0.995xw:1.00xh;0.00321xw,0&resize=1200:*"
        />
      </div>
      <p className={style.content}>{content}</p>
      <div></div>
    </Card>
  );
}

export default AccountNews;
